fun String.reduce(): String {
    return mutableListOf<Char>().apply {
        this@reduce.forEach { char ->
            when {
                isEmpty() -> add(char)
                char.implodes(last()) -> removeAt(size - 1)
                else -> add(char)
            }
        }
    }.joinToString("")

}

fun Char.implodes(other: Char): Boolean {
    val thisIsUppercase = (this.toUpperCase() == this)
    val otherIsUppercase = (other.toUpperCase() == other)
    return (thisIsUppercase == !otherIsUppercase) && this.toUpperCase() == other.toUpperCase()
}

